function App() {
  return (
    <div className="App">
      <Header/>
        <Switch>
            <Route exact path='/' component={Register}/>
            <Route exact path='/employees' component={EmployeeContainer}/>
            <Route exact path='/login' component={Login}/>
            <Route component = {My404}/>
        </Switch>
    </div>
  );
}

export default App;
